import api from "../../API/Api";

const getCompanySoleAndPartinershipInformation = (CompanyId) => {
  return api.get(`/company/${CompanyId}/SoleAndPartnership`, {
    headers: {
      Authorization: `bearer ${localStorage.getItem("token")}`,
      "Content-Type": "application/json",
    },
  });
};

const addSoleAndPartnership = (data, companyId) => {
  return api.post(`/company/${companyId}/SoleAndPartnership`, data, {
    headers: {
      Authorization: `bearer ${localStorage.getItem("token").token}`,
      "Content-Type": "application/json",
    },
  });
};

const getSoleTax1 = (Id) => {
  return api.get(`/taxClerance/${Id}`, {
    headers: {
      Authorization: `bearer ${localStorage.getItem("token")}`,
      "Content-Type": "application/json",
    },
  });
};
const addTaxSoleInfo = (data, SoleAndPartnershipId) => {
  
  return api.post(
    `company/SoleAndPartnership/${SoleAndPartnershipId}/TaxClerance`,
    data,
    {
      headers: {
        Authorization: `bearer ${localStorage.getItem("token")}`,
        "Content-Type": "application/json",
      },
    }
  );
};
const getSole = (Id) => {
  debugger;
  return api.get(`/company/soleAndPartnership/${Id}`, {
    headers: {
      Authorization: `bearer ${localStorage.getItem("token")}`,
      "Content-Type": "application/json",
    },
  });
};

const updateSoleById = (Id , data ) => {
  debugger
  return api.put(`/company/SoleAndPartnership/${Id}`, data, {
    headers: {
      Authorization: `bearer ${localStorage.getItem("token")}`,
      "Content-Type": "application/json",
    },
  });
};

const SoleAndPartnershipService = {
  getCompanySoleAndPartinershipInformation,
  addSoleAndPartnership,
  getSoleTax1,
  addTaxSoleInfo,
  getSole,
  updateSoleById,
};
export default SoleAndPartnershipService;
